B.zD=new A.bq("1","Arabica","Arabica is the most popular type of coffee, hands down. Depending on who you ask, many coffee enthusiasts prefer using Arabica beans due to its taste. Typically used for black coffee, Arabica beans have a sweeter, more complex flavor that you can drink straight. Funny thing is, even though it\u2019s the most popular, it doesn\u2019t have as much caffeine as Robusta.","https://images.pexels.com/photos/5472417/pexels-photo-5472417.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.zu=new A.bq("2","Robusta","While Arabica is the most popular, Robusta is cheaper and stronger. Because of its bitter flavor, you\u2019ll typically see Robusta used for espresso drinks and in instant coffee mixes. If your Monday morning is lagging, reach for a cup of coffee that uses Robusta beans. Their high caffeine content will wake you right up!","https://images.pexels.com/photos/7507355/pexels-photo-7507355.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
